  Kenneth b. at Foxton, m. at Sydney and d. at Hastings. Daisy, d/o Joseph Palmer
  (stockbroker) and Annie Maria Smith, b, and d, at Sydney. The family firm of Joseph Palmer
  and Sons, stockbrokers, founded in 1872, is still trading in Sydney as a family partnership.
  Kenneth was educated at Heretaunga, Wanganui Collegiate School, Jesus College, Cambridge
  (MA) and Cuddesdon College, England, and was ordained in 1911 at Farnham, Surrey, in the
  Diocese of Winchester. He served as Curate of Portsea (1911), and as Vicar of Rotorua
  (1914), of Woodville (1918) and of Havelock North (1921).
